docx_txt_159.text = "La depressione postnatale di solito compare dal primo al terzo mese dopo la nascita, anche se può verificarsi fino a un anno dopo la nascita del bambino. Alcuni dei sintomi nella mamma, come stanchezza, irritabilità o scarso appetito, sono normali nella prima o seconda settimana dal parto, ma di solito sono lievi e non impediscono di condurre una vita normale. Con la depressione postnatale, il genitore potrebbe sentirsi sempre più triste e scoraggiato, e prendersi cura di se stesso o del bambino potrebbe rivelarsi una fatica esasperante. Anche i papà possono soffrire di depressione dopo la nascita del figlio. La depressione del genitore può influire sullo sviluppo del bambino. Parlare con il/la pediatra del vostro umore e dei vostri sentimenti è importante. ";
