const docx_txt_209 = {};
docx_txt_209.text = "Il rigurgito è una manifestazione molto frequente in tutto il primo anno di vita ed è causato dal latte che risale dall'esofago fino alla bocca. Il rigurgito è considerato un evento normale nel lattante, soprattutto nei primi sei - dieci mesi di vita. Con il passaggio all'alimentazione solida nel secondo semestre e con la maturazione dell'apparato digestivo il rigurgito si risolve spontaneamente. Non si deve curare il rigurgito con medicine o sostanza speciali; è sufficiente offrire al bambino la posizione semiseduta o tenerlo in braccio in posizione verticale. Se il rigurgito è associato a pianti prolungati che non si riescono a consolare e il bambino non cresce di peso è utile confrontarsi con il pediatra. ";
