const docx_txt_469 = {};
docx_txt_469.text = "I bambini piccoli, in particolare quelli di età compresa tra 1 e 3 anni, possono essere intossicati da sostanze presenti in casa come farmaci, prodotti per la pulizia, piante, cosmetici, pesticidi, vernici, solventi, antigelo, tergicristallo fluido, benzina, cherosene, olio per lampade, sostanze stupefacenti. In questa fascia di età è normale per un bambino voler esplorare l’ambiente o imitare quello che i genitori fanno. Inoltre le routine frenetiche alla fine della giornata di lavoro possono causare cali nell'attenzione dei genitori. È bene tenere tutti i veleni, i farmaci e le sostanze tossiche fuori dalla vista e dalla portata dei bambini, in un armadietto chiuso e non raggiungibile. Attenzione quando andiamo in altre abitazioni per il pericolo di sostanze velenose a portata di bambino.";
