const docx_txt_718 = {};
docx_txt_718.text = ". All’inizio il bambino preferisce libri con immagini semplici, dove sono illustrati dei volti o degli oggetti domestici. Dal secondo anno di vita è interessato anche a libri che raccontano storie molto semplici, dove sono presenti pochi personaggi. la miglior lettura è quella con conversazione, stimolando il bambino a partecipare con semplici risposte alle domande che il genitore propone già a partire dalla fine del secondo anno di vita. Le domande da fare nel bambino piccolo devono essere semplici, ad esempio “Dov’è l’albero?”, “Come si chiama questo animale?”, “Che cosa è?”. Se il bambino non risponde, il genitore stesso risponde alla domanda e invita il bambino a ripetere la risposta. Se il bambino risponde alla domanda, il genitore ripete la risposta del bambino raccontando qualcosa di più, ad esempio: “Si questo animale si chiama giraffa e questo è il suo collo, molto lungo”. Nei bambini più grandicelli il genitore potrà fare domande più complesse come: “Cosa sta facendo il maialino?”, “Perché è triste il bambino?”. È buona cosa utilizzare il dito per segnare il punto dell’immagine che si sta spiegando, un ottimo aiuto per indirizzare l’attenzione del bambino.";
