const docx_txt_806 = {};
docx_txt_806.text = "Il mal di gola accompagna molti disturbi, dal raffreddore alla tonsillite. Nella maggior parte dei casi il mal di gola è causato da un virus e guarisce spontaneamente dopo 3- 5 giorni. Solo in un terzo dei casi il mal di gola può essere un sintomo della tonsillite da streptococco; questa malattia è rara nei bambini al di sotto dei 3 anni. Per diagnosticare la tonsillite da streptococco il pediatra si basa sulla presenza di alcuni sintomi tra cui la febbre, la presenza di secrezione sulle tonsille, alcuni linfonodi ingrossati, oppure potrà effettuare un tampone faringeo per confermare la presenza dello streptococco. Il trattamento antibiotico è utile per guarire dalla tonsillite streptococcica ma non funziona nel caso di mal di gola causato da infezioni virali come il raffreddore o l'influenza.";
