docx_txt_828.text = "Starnuti, naso chiuso o che cola, mal di gola e un po' di tosse. Sono i sintomi del raffreddore. Ogni bambino ogni anno presenta uno o più raffreddori. Questo disturbo nel bambino può durare da una a tre settimane. Come si cura?";
