const docx_txt_832 = {};
docx_txt_832.text = "Quale medicina è provata essere la migliore per il raffreddore? Nessuna, secondo gli studi scientifici. Non ci sono sciroppi o spray speciali o gocce che fanno la differenza, non c’è nessun prodotto che fa guarire prima. La guarigione è spontanea e la cura consiste in una buona idratazione - ossia bere acqua - e nella pulizia del naso. Se il bambino non è in grado di soffiarsi il naso può essere utile fare i lavaggi nasali con la soluzione salina. Oggi sono presenti sul mercato moltissimi preparati per effettuare i lavaggi nasali: quale preferire tra questi? La semplice soluzione salina isotonica, chiamata anche soluzione fisiologica o acqua di mare, va benissimo e si può comprare non solo in farmacia in comodi flaconi da mezzo litro, ma anche al supermercato. E altre soluzioni di lavaggio? La soluzione ipersalina, nei pochi studi effettuati, non appare migliorare di molto la sintomatologia, ma può presentare più effetti negativi come bruciore, ostruzione e gocciolamento nasale. E gli antibiotici? Non funzionano contro il raffreddore; e non solo sono inutili ma potrebbero dare fastidiosi problemi come diarrea o un aumentata resistenza ai germi.";
