const docx_txt_1471 = {};
docx_txt_1471.text = "L’attività del pediatra si svolge non solo nella cura delle malattie, ma in particolar modo, nella prevenzione. In occasione dei “bilanci di salute” il pediatra effettua visite di controllo secondo un calendario prestabilito. Durante queste visite il pediatra controlla la crescita, la presenza dello sviluppo puberale, valuta la presenza di un eccesso di peso, si confronta con la famiglia per rilevare possibili difficoltà nello studio e negli apprendimenti scolastici, si confronta con il ragazzo/a su possibili difficoltà nella socializzazione, nell’umore o nella presenza di difficoltà familiari. Durante le visita il pediatra può controllare la pressione arteriosa, la corretta postura e la curvatura della colonna vertebrale. Insieme al pediatra si possono impostare programmi salutari per tutta la famiglia, come una corretta attività fisica, una alimentazione equilibrata, e affrontare piccoli o grandi problemi che preoccupano il ragazzo/a i suoi famigliari. Infine si possono discutere i programmi vaccinali che coinvolgono i ragazzi/e dell’età scolare. Incontrare il pediatra in occasione dei bilanci di salute è una preziosa opportunità: i genitori e i ragazzi/e devono saper sfruttare questa occasione di confronto per chiarire gli obiettivi della propria salute.";
